import React from "react";
import start0 from "./images/start0.png";
import { useSelector } from "react-redux";

export default function HangmanLogic() {
  const player = useSelector((state) => state.player);
  return (
    <div className="flex flex-wrap justify-center object-center h-3/4">
      <div>Username: {player} </div>
      <div className="w-1/5">
        <img
          src={start0}
          className="shadow rounded align-middle border-none"
          alt="hangmangame"
        />
      </div>
    </div>
  );
}
